ST.xhtml:
//デバッグ用
i:=0;
productMap.Values(iterator);
WHILE iterator.HasNext() DO
	iterator.Next(itfElement=>itfElement);
	xResult := __QUERYINTERFACE(itfElement, itfProductElement);
	tmpValues[i] := itfProductElement.ProductValue;
	i:=i+1;
END_WHILE

//メッセージBOXを閉じる
IF msgBoxTap THEN
	msgBoxEnabled := FALSE;
	msgBoxTap := FALSE;
END_IF


//現在状態ごとの処理
IF state = E_ProductSettingState.Initial AND pnArrayLastIndex <> 0 THEN
	selectedProductIndex := 0;
	UpdateSelectedProduct();
	state := E_ProductSettingState.Edit;
END_IF

IF pnArrayLastIndex > GVL.MAX_PRODUCT_NUM THEN
	RETURN;
END_IF


IF pnArrayLastIndex <> 0 THEN
	//昇順にソートされている前提で挿入個所を探索する
	FOR deleteIndex:=0 TO pnArrayLastIndex-1 DO
		productId := GetIdFromProductName(ADR(productNameArray[deleteIndex]));
		IF info.id = productId THEN
			productNameArray[deleteIndex] := '';
			EXIT;
		END_IF
	END_FOR

	//空いた箇所を詰める
	IF deleteIndex <> pnArrayLastIndex-1 THEN
		FOR i:=deleteIndex TO pnArrayLastIndex-1 DO
			productNameArray[i] := productNameArray[i+1];
		END_FOR
	END_IF

	productNameArray[pnArrayLastIndex-1] := '';
	pnArrayLastIndex := pnArrayLastIndex - 1;

END_IF

IF pnArrayLastIndex > GVL.MAX_PRODUCT_NUM THEN
	RETURN;
END_IF

concatStr := CONCAT(info.id, '.');
concatStr := CONCAT(concatStr, info.name);

IF pnArrayLastIndex <> 0 THEN
	//昇順にソートされている前提で挿入個所を探索する
	FOR i:=0 TO pnArrayLastIndex-1 DO
		productId := GetIdFromProductName(ADR(productNameArray[i]));
		IF info.id = productId THEN
			productNameArray[i] := concatStr;
			EXIT;
		END_IF
	END_FOR
END_IF

//表示中のデータを削除
eError := productMap.RemoveByKey(itfKey := StringElementFactory.Create(sValue := visuProduct.id));

//削除成功時
IF eError = COL.COLLECTION_ERROR.NO_ERROR THEN
	concatStr := CONCAT(visuProduct.id, '.');
	concatStr := CONCAT(concatStr, visuProduct.name);
	concatStr := CONCAT(concatStr, ' を削除しました');
	msgBoxMessage := concatStr;
	msgBoxEnabled := TRUE;
	//表示用Listの更新
	DeleteProductFromNameArray(visuProduct);
	ClearVisuProduct();
	state := E_ProductSettingState.Initial;

ELSE
	state := E_ProductSettingState.Initial;
END_IF;

keyElement := StringElementFactory.Create(sValue := visuProduct.id);
eError := productMap.ContainsKey(itfKey:=keyElement, xResult=>contains);

CASE state OF
	//更新時
	E_ProductSettingState.Edit:
		IF contains THEN

			eError := productMap.RemoveByKey(itfKey := keyElement);
			eError := productMap.AddKeyValuePair(itfKey := keyElement, itfValue := productElementFactory.Create(visuProduct));

			IF eError = COL.COLLECTION_ERROR.NO_ERROR THEN
				concatStr := CONCAT(visuProduct.id, '.');
				concatStr := CONCAT(concatStr, visuProduct.name);
				concatStr := CONCAT(concatStr, ' を更新しました');
				msgBoxMessage := concatStr;
				msgBoxEnabled := TRUE;
				UpdateProductToNameArray(visuProduct);
			ELSE
				msgBoxMessage := '更新に失敗しました。';
				msgBoxEnabled := TRUE;	
			END_IF
		END_IF

	//新規追加時
	E_ProductSettingState.Create:
		IF pnArrayLastIndex > GVL.MAX_PRODUCT_NUM-1 THEN
			msgBoxMessage := '登録可能な製品数の上限に達しています。';
			msgBoxEnabled := TRUE;
			RETURN;
		END_IF

		IF contains THEN
			msgBoxMessage := '既に同じIDが登録されています。別のIDをご使用ください。';
			msgBoxEnabled := TRUE;
			RETURN;
		END_IF

		eError := productMap.AddKeyValuePair(itfKey := keyElement, itfValue := productElementFactory.Create(visuProduct));

		IF eError = COL.COLLECTION_ERROR.NO_ERROR THEN
			concatStr := CONCAT(visuProduct.id, '.');
			concatStr := CONCAT(concatStr, visuProduct.name);
			concatStr := CONCAT(concatStr, ' を新規で追加しました');
			msgBoxMessage := concatStr;
			msgBoxEnabled := TRUE;
			//表示用Listの更新
			selectedProductIndex := InsertProductToNameArray(visuProduct);

			state := E_ProductSettingState.Edit;

		ELSE
			msgBoxMessage := '新規追加に失敗しました。';
			msgBoxEnabled := TRUE;
			state := E_ProductSettingState.Initial;
		END_IF

END_CASE

IF pnArrayLastIndex > GVL.MAX_PRODUCT_NUM-1 THEN
	RETURN;
END_IF

concatStr := CONCAT(info.id, '.');
concatStr := CONCAT(concatStr, info.name);


IF pnArrayLastIndex <> 0 THEN
	//昇順にソートされている前提で挿入個所を探索する
	FOR insertIndex:=0 TO pnArrayLastIndex-1 DO
		IF concatStr < productNameArray[insertIndex] THEN
			EXIT;
		END_IF
	END_FOR

	//挿入個所をあけるために1つずつずらす
	IF insertIndex <> pnArrayLastIndex THEN
		FOR i:=pnArrayLastIndex TO insertIndex+1 DO
			productNameArray[i] := productNameArray[i-1];
		END_FOR	
	END_IF
END_IF

productNameArray[insertIndex] := concatStr;
pnArrayLastIndex := pnArrayLastIndex + 1;

InsertProductToNameArray := insertIndex;

selectedProductName := productNameArray[selectedProductIndex];
selectedProductId := GetIdFromProductName(ADR(selectedProductName));
visuProduct := GetProductInfo(selectedProductId);

state := E_ProductSettingState.Create;
selectedProductIndex := pnArrayLastIndex;

ClearVisuProduct();

state := E_ProductSettingState.Initial;
selectedProductIndex := 0;
UpdateSelectedProduct();

visuProduct.height := 0;
visuProduct.id := '';
visuProduct.length := 0;
visuProduct.name := '';
visuProduct.width := 0;

//MapからProductインスタンスを取得
itfStringKey := StringElementFactory.Create(sValue := id);
eError := productMap.GetElementByKey(itfKey := itfStringKey, itfValue => itfElement);
IF eError <> COL.COLLECTION_ERROR.NO_ERROR THEN
	RETURN;
END_IF

//キーの確認
xResult := __QUERYINTERFACE(itfStringKey, itfIInstance);
IF xResult THEN
	// Remove the temporary key
	itfIInstance.Dispose();
END_IF

//IElement形式からIProductElementに変換
xResult := __QUERYINTERFACE(itfElement, itfProductElement);
IF xResult THEN
	GetProductInfo := itfProductElement.ProductValue;
END_IF

xResult := __QUERYINTERFACE(itfElement, element);
elementProduct := element.ProductValue;
thisProduct := ProductValue;
IF xResult THEN
	ElementEquals := thisProduct.id = elementProduct.id;	
ELSE
	ElementEquals := FALSE;
END_IF

// We use integer iInt1 for sorting.
xResult := __QUERYINTERFACE(itfElement, element);
IF xResult THEN
	elementProduct := element.ProductValue;
	IF _product.id < elementProduct.id THEN
		ElementCompareTo := -1;
	ELSIF _product.id > elementProduct.Id THEN
		ElementCompareTo := 1;
	ELSE
		ElementCompareTo := 0;
	END_IF
ELSE
	ElementCompareTo := -1;
END_IF

SUPER^.prvInstInit(itfData);
xOk := __QUERYPOINTER(itfData, pData);
IF xOk THEN
	ProductValue := pData^.info;
END_IF

(* !!! This code must not be subject to change !!! *)
itfData(info:=inputData);
hInst := SUPER^.prvAllocInstMem(eError => eError);
pInstance := SUPER^.prvGetInstPointer(hInst);
IF pInstance <> 0 AND eError = FBF.ERROR.NO_ERROR THEN

	{implicit on}
	pInstance^.__vfInit();
	pInstance^.FB_Init(TRUE, FALSE);
	{implicit off}

	xOk := __QUERYINTERFACE(pInstance^, itfInst);
	IF xOk THEN
		xOk := SUPER^.prvInstInit(itfInst, hInst, itfData, eError=>eError);
	ELSE
		eError := FBF.ERROR.WRONG_INTERFACE;
	END_IF

	IF NOT xOk THEN
		SUPER^.prvFreeInstMem(hInst);
		Create := CAA.gc_pNULL;
    ELSE
        __QUERYINTERFACE(pInstance^, Create);
	END_IF
END_IF

(* Please choose a proper value for prvInstPoolExtendsFactor *)
(* This value will be interpreted as a 0..x% size extendsion related to the original size of the pool *)
prvInstPoolExtendsFactor := 20;
